import React from "react";
import DayListItem from "./DayListItem";
import "./DayListItem.scss";

export default function DayList(props) {
  const dayListSection = props.days.map(days => (
    <DayListItem
      key={state.days.id}
      name={state.days.name}
      spots={state.days.spots}
      selected={state.days.name === props.day}
      setDays={props.setDays}
    />
  ))
  return(<ul>{dayListSection}</ul>);
};
